(26, 6, 13, 12, '2025-11-16 16:55:34', '', NULL, 'despues', 'Consumir dentro de los 30 minutos posteriores a finalizar tu sesión de ciclismo para maximizar la recuperación muscular y de glucógeno.', '1 porción', 30),
(27, 6, 14, 4, '2025-11-16 16:57:01', '', NULL, 'antes', 'Consumir 30 minutos antes del inicio del entrenamiento para asegurar la disponibilidad energética.', '1 gel', 30),
(28, 6, 14, 3, '2025-11-16 16:57:01', '', NULL, 'durante', 'Consumir cada hora de entrenamiento para mantener niveles óptimos de energía y electrolitos. Si la duración del entrenamiento es superior a 1 hora, considera consumir múltiples geles.', '1 gel por hora', NULL),
(29, 6, 14, 12, '2025-11-16 16:57:01', '', NULL, 'despues', 'Consumir dentro de los 30 minutos posteriores a finalizar el entrenamiento para maximizar la recuperación muscular y la reposición de reservas energéticas.', '1 porción', 30),
(33, 6, 16, 6, '2025-11-16 17:08:39', '', NULL, 'antes', 'Consumir 1 barra unos 30 minutos antes de iniciar el entrenamiento de ciclismo para asegurar un suministro de energía sostenido.', '1 barra', 30),
(34, 6, 16, 17, '2025-11-16 17:08:39', '', NULL, 'durante', 'Mezclar el polvo con agua según las indicaciones del envase. Consumir entre 80-120g de carbohidratos por hora de ejercicio para mantener los niveles de energía. Dada la alta sudoración, asegúrese de rehidratarse adecuadamente.', '80-120g (dependiendo de la duración)', NULL),
(35, 6, 16, 12, '2025-11-16 17:08:39', '', NULL, 'despues', 'Consumir inmediatamente después de finalizar el entrenamiento para optimizar la recuperación muscular y la reposición de energía.', '1 porción', 30);

